import React from 'react';

function TaskFilter({ currentFilter, onChange }) {
  return (
    <div className="filter-group">
      <button
        onClick={() => onChange('all')}
        className={"btn-toggle" + (currentFilter === 'all' ? ' active' : '')}
      >
        All
      </button>
      <button
        onClick={() => onChange('completed')}
        className={"btn-toggle" + (currentFilter === 'completed' ? ' active' : '')}
      >
        Completed
      </button>
      <button
        onClick={() => onChange('pending')}
        className={"btn-toggle" + (currentFilter === 'pending' ? ' active' : '')}
      >
        Pending
      </button>
    </div>
  );
}

export default TaskFilter;
